\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSmart creatives, though, place culture at the top of the list. To be effective, they need to care about the place they work. This is why, when starting a new company or initiative, culture is th\n\nOctober 25, 2014\n\u001c37\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOnce established, company culture is very difficult to change, because early on in a company’s life a self-selection tendency sets in. People who believe in the same things the company does will be drawn to work there, while people who don’t, won’t.23\n\nOctober 25, 2014\n\u001c37\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cCulture stems from founders, but it is best reflected in the trusted team the founders form to launch their venture. So ask that team: What do we care about? What do we believe? Who do we want to be\n\nOctober 25, 2014\n\u001c38\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ccompanies exist to “do something worthwhile—they make a contribution to society\n\nOctober 25, 2014\n\u001c39\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ccompanies exist to “do something worthwhile—they make a contribution to society\n\nOctober 25, 2014\n\u001c39\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cauthentic. A good litmus test is to ask what would happen if you changed the statements that describe culture\n\nOctober 25, 2014\n\u001c39\n\u0011\n\u0011\n\n\nWork, eat, and live together\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001csmart-creative product managers need to find the technical insights that make products better.\n\nOctober 25, 2014\n\u001c45\n\u0011\n\u0011\n\n\nYour parents were wrong—messiness is a virtue\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cserendipitous encounter will never happen when you are working at home.\n\nOctober 25, 2014\n\u001c47\n\u0011\n\u0011\n\n\nDon’t listen to the HiPPOs\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cmeritocracy to work, it needs to engender a culture where there is an “obligation to dissent”.38\n\nOctober 26, 2014\n\u001c48\n\u0011\n\u0011\n\n\nExile knaves but fight for divas\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAnd generally, in our experience, once a knave, always a knave. (Tom Peters: “There is no such thing as a minor lapse of integrity.”)\n\nOctober 26, 2014\n\u001c56\n\u0011\n\u0011\n\n\nEstablish a culture of Yes\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMy first word of advice is this: Say yes. In fact, say yes as often as you can. Saying yes begins things. Saying yes is how things grow. Saying yes leads to new experiences, and new experiences will lead you to knowledge and wisdom.… An attitude of yes is how you will be able to go forward in these uncertain times.”48\n\nGo visit GHIT Fund. Go talk to Sophia GHIT chemist. Say yes, to Masa\u0027s offer to lead a project at IGS. Say yes to helping KH answer the big questions he needs to address for his venture next fall.\n\nOctober 26, 2014\n\u001c59\n\u0011\n\u0011\n\n\nAh’cha’rye\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAs someone launching a new venture (or reinventing an established one), you are signing up for long days, sleepless nights, and maybe some missed birthday parties. You will hire people who need to believe in you and your idea enough to be willing to make the same sacrifices. To do all this, you have to be crazy enough to think you will succeed, but sane enough to make it happen. This requires commitment, tenacity, and most of all, single-mindedness.\n\nOctober 26, 2014\n\u001c67\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLeadership requires passion. If you don’t have it, get out now.\n\nWork on becoming a better leader in: Your family Project Tsubasa Shinnyoen Your IGS project Your friend circle\n\nOctober 26, 2014\n\u001c68\n\u0011\n\u0011\n\n\nStrategy—Your Plan Is Wrong\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cinvesting in the team, not the plan. Since the plan is wrong, the people have to be right. Successful teams spot the flaws in their plan and adjust.\n\nOctober 26, 2014\n\u001c71\n\u0011\n\u0011\n\n\nBet on technical insights, not market research\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cmarket research can’t tell you about solving problems that customers can’t conceive are solvable. Giving the customer what he wants is less important than giving him what he doesn’t yet know he wants.\n\nOctober 26, 2014\n\u001c76\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001clacked that fundamental technical insight that would shift the cos\n\nIs grow based on a technical insight?\n\nOctober 26, 2014\n\u001c77\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1atEWkzDehOH7ItARIl-l7fbeh_mgBqoCKt3kfi4","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1cUP3FOzW4V9Z34wwOT5br7BVCh-onR8YVxrSKyQ","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"l