13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":3926,"ei":3943,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":3944,"ei":3961,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}},{"ty":"as","st":"text","si":3962,"ei":4029,"sm":{"ts_ff_i":false,"ts_it":true,"ts_va":"nor","ts_va_i":false,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":4030,"ei":4068,"sm":{"ts_ff_i":false,"ts_fgc":"#424242","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4069,"ei":4086,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4087,"ei":4092,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="CpbDIebKJtwE1anvd48BHcdN1XE"  nonce="CpbDIebKJtwE1anvd48BHcdN1XE">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="CpbDIebKJtwE1anvd48BHcdN1XE"  nonce="CpbDIebKJtwE1anvd48BHcdN1XE">DOCS_modelChunk = [{"ty":"is","ibi":4093,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cperformance curve nonincrementally and provide significant differentiation.\n\nHow can we either shift the cost curve non incrementally or provide significant differentiation?\n\nOctober 26, 2014\n\u001c77\n\u0011\n\u0011\n\n\nDon’t look for faster horses\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat is your technical insight?” turns out to be an easy question to ask and a hard one to answer. So for your products, ask the question. If you can’t articulate a good answer, rethink the product.\n\nOctober 26, 2014\n\u001c80\n\u0011\n\u0011\n\n\nOptimize for growth\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cScaling needs to be a core part of your foundation. Competition is much more intense and competitive advantages don’t last long, so you have to have a “grow big fast” strategy.\n\nOctober 26, 2014\n\u001c81\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001csuccessful foundation must provide a good basis for revenue generation. The old dot-com mantra of “We have no idea how we’re going to make money (but look at our sock puppet!)” didn’t cut it then and still doesn’t. The Google founders knew that they would make money from advertising. Initially they didn’t know exactly how, and they were biding their time while scaling their platform, but they were very clear about the general revenue model.\n\nOctober 26, 2014\n\u001c83\n\u0011\n\u0011\n\n\nCoase and the nature of the firm\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTwitter is not a technology company, it is a publishing company\n\nOctober 26, 2014\n\u001c85\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThese companies assembled existing technology components in new way\n\nOctober 26, 2014\n\u001c85\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThere are platform opportunities all around us. The successful leaders are the ones who discover them\n\nOctober 26, 2014\n\u001c86\n\u0011\n\u0011\n\n\nDon’t follow competition\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cspiral into mediocrity. Business leaders spend much of their time watching and copying the competition, and when they do finally break away and try something new, they are careful risk-takers, developing only incremental, low-impact changes. Being close to your competition offers comfort;\n\nWho is our competition. Now let\u0027s not follow them.\n\nOctober 26, 2014\n\u001c92\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn general I think there’s a tendency for people to think about the things that exist. Our job is to think of the thing you haven’t thought of yet that you really need. And by definition, if our competitors knew that thing, they w\n\nOctober 26, 2014\n\u001c93\n\u0011\n\u0011\n\n\n■ Eric’s Notes for a Strategy Meeting\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe right strategy has a beauty to it, a sense of many people and ideas working in concert to succeed. Start by asking what will be true in five years and work backward.\n\nOctober 26, 2014\n\u001c93\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn a five-year timeline there are disrupters—and opportunities—in many markets. What will be the disrupters affecting you?\n\nOctober 26, 2014\n\u001c94\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cGrowth matters most. All big successes in the Internet Century will embody large platforms that get better and stronger as they grow.\n\nOctober 26, 2014\n\u001c94\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cArticulate a rough time frame and the end point you want to achieve.\n\nOctober 26, 2014\n\u001c94\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cGet input from everyone in the room. Iteration is the most important part of the strategy. It needs to be very, very fast and always based on learning.\n\nOctober 26, 2014\n\u001c94\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMany large, successful companies started with the following: 1. They solved a problem in a novel way. 2. They used that solution to grow and spread quickly. 3. That success was based largely on their products.\n\nOctober 26, 2014\n\u001c94\n\u0011\n\u0011\n\n\nTalent—Hiring Is the Most Important Thing You Do\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSmart coaches know that no amount of strategy can substitute for talent, and that is as true in business as it is on the field. Scouting is like shaving: If you don’t do it every day, it shows\n\nOctober 27, 2014\n\u001c98\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cbringing the best possible people into the company, even if their experience might not match one of the open roles. Eric hired Sheryl Sandberg even though he didn’t have a job for her.\n\nOctober 27, 2014\n\u001c100\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe smart creatives matter more than the role;\n\nOctober 27, 2014\n\u001c100\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001chiring well takes a lot of work and time. But it is the best investment you can make\n\nOctober 27, 2014\n\u001c100\n\u0011\n\u0011"},{"ty":"te","id":"i.17","spi":4102},{"ty":"te","id":"i.18","spi":4344},{"ty":"te","id":"i.19","spi":4602},{"ty":"te","id":"i.20","spi":4816},{"ty":"te","id":"i.21","spi":5333},{"ty":"te","id":"i.22","spi":5434},{"ty":"te","id":"i.23","spi":5539},{"ty":"te","id":"i.24","spi":5705},{"ty":"te","id":"i.25","spi":6084},{"ty":"te","id":"i.26","spi":6392},{"ty":"te","id":"i.27","spi":6599},{"ty":"te","id":"i.28","spi":6759},{"ty":"te","id":"i.29","spi":6930},{"ty":"te","id":"i.30","spi":7036},{"ty":"te","id":"i.31","spi":7225},{"ty":"te","id":"i.32","spi":7523},{"ty":"te","id":"i.33","spi":7753},{"ty":"te","id":"i.34","spi":7976},{"ty":"te","id":"i.35","spi":8061},{"ty":"as","st":"paragraph","si":4093,"ei":4093,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":4094,"ei":4094,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":