11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":8064,"ei":8149,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":8150,"ei":8167,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="CpbDIebKJtwE1anvd48BHcdN1XE"  nonce="CpbDIebKJtwE1anvd48BHcdN1XE">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="CpbDIebKJtwE1anvd48BHcdN1XE"  nonce="CpbDIebKJtwE1anvd48BHcdN1XE">DOCS_modelChunk = [{"ty":"is","ibi":8175,"s":"\n\n\nThe herd effect\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwhen you put great people with great people, you create an environment where they will share ideas and work on them. This is always true, but particularly in an early-stage environment.\n\nOctober 27, 2014\n\u001c101\n\u0011\n\u0011\n\n\nPassionate people don’t use the word\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPassionate people don’t wear their passion on their sleeves; they have it in their hearts. They live it. Passion is more than résumé-deep, because its hallmarks—persistence, grit, seriousness, all-encompassing absorption—cannot be gauged from a checklist.\n\nOctober 27, 2014\n\u001c102\n\u0011\n\u0011\n\n\nHire learning animals\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHenry Ford said that “anyone who stops learning is old, whether at twenty or eighty. Anyone who keeps learning stays young. The greatest thing in life is to keep your mind young.”94 Our ideal candidates are the ones who prefer roller coasters, the ones who keep learning. These “learning animals” have the smarts to handle massive change and the character to love it.\n\nOctober 27, 2014\n\u001c104\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPsychologist Carol Dweck has another term for it. She calls it a “growth mindset.”95\n\nOctober 27, 2014\n\u001c104\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA smart generalist doesn’t have bias, so is free to survey the wide range of solutions and gravitate to the best one.\n\nOctober 27, 2014\n\u001c105\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cmployee to be constantly learning new things—even skills and experiences that aren’t directly beneficial to the company—and then expect them to use them. This won’t be challenging for true learning animals, who will gladly avail themselves of training and other opportunities\n\nOctober 27, 2014\n\u001c106\n\u0011\n\u0011\n\n\nInsight that can’t be taught\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cGreat talent often doesn’t look and act like you. When you go into that interview, check your biases at the door103 and focus on whether or not the person has the passion, intellect, and character to succeed and excel\n\nOctober 27, 2014\n\u001c109\n\u0011\n\u0011\n\n\nExpand the aperture\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe ideal candidate is out there. She has passion, intellect, integrity, and a unique perspective. Now, how do you find her and get her on board? There are four links in this critical chain: sourcing, interviewing, hiring, and compensation\n\nOctober 27, 2014\n\u001c109\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLet’s start with sourcing, which in turn starts with defining the type of candidate for whom you are looking. Our recruiting partner Martha Josephson calls this “expanding the aperture.” The aperture is the opening in a camera through which light flows to the sensors that capture the image. A typical hiring manager will have a narrow aperture, considering only certain people with certain titles in certain fields, those who will undoubtedly do today’s job well. But the succes\n\nOctober 27, 2014\n\u001c109\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou can get great talent if you are willing to take a risk on people by challenging them to do new thin\n\nOctober 27, 2014\n\u001c110\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001clots of companies hire smart recent graduates—that’s the easy part. The hard part is to give them vital roles in projects with real impact. Smart creatives thrive in these positions, while risk-averse managers cringe. They have no experience! (Good!) What if they screw up? (They will, but they will also succeed in ways you can’t imagine.)\n\nOctober 27, 2014\n\u001c110\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOne way to make expanding the aperture work is to judge candidates based on trajectory. Our former colleague Jared Smith notes that the best people are often the ones whose careers are climbing, because when you project their path forward there is potential for great growth and achievement. There are plenty of strong, experienced people who have hit a plateau. With those candidates, you know exactly what you are getting (which is good) but there is much less potential for the extraordinary (bad\n\nOctober 27, 2014\n\u001c111\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cExpanding the aperture brings risks. It leads to some failures, and the start-up costs for hiring a brilliant, inexperienced person are higher than those of hiring a less-brilliant, experienced one. The hiring manager may not want to bear the costs, but such concerns need to be set aside for the greater good. Hiring brilliant generalists is far better for the company.\n\nOctober 27, 2014\n\u001c113\n\u0011\n\u0011"},{"ty":"te","id":"i.36","s