0000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":12321,"ei":12338,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="CpbDIebKJtwE1anvd48BHcdN1XE"  nonce="CpbDIebKJtwE1anvd48BHcdN1XE">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="CpbDIebKJtwE1anvd48BHcdN1XE"  nonce="CpbDIebKJtwE1anvd48BHcdN1XE">DOCS_modelChunk = [{"ty":"is","ibi":12346,"s":"\n\n\nEveryone knows someone great\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cit is easy for any company to double in size with great people. All it takes, as Larry often told us, is for each employee to refer just one great person.\n\nOctober 27, 2014\n\u001c114\n\u0011\n\u0011\n\n\nInterviewing is the most important skill\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe loftier your hiring aspirations, the more challenging and important the interview process becomes. The interview is where you truly learn about a person—it is far more important than the résumé. The résumé tells you that the person got a 3.8 from an elite school while majoring in computer science and running track; the interview tells\n\nOctober 27, 2014\n\u001c114\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe most important skill any business person can develop is interviewing. You’ve probably never read that in any management book or heard it in an MBA course. CEOs, professors, and venture capitalists always (correctly) preach the primacy of people when it comes to success, but they often don’t say how to get those great people. They talk in theory, but business is practice and in practice your job is to determine a candidate’s merit in the context of an artificial, time-constrained interview. That calls for a unique and difficult skill set, and the simple truth is most people are not good at it.\n\nOctober 27, 2014\n\u001c114\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cConducting a good interview requires something different: preparation. This is true regardless of whether you’re a senior executive or a fresh associate. Being a good interviewer requires understanding the role, reading the résumé, and—most important—considering your                                         \n\nOctober 27, 2014\n\u001c115\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou need to ask challenging questions that push the candidate. What was the low point in the project? Or why was it successful? You want to learn if the candidate was the hammer or the egg, someone who caused a change or went along with it\n\nOctober 27, 2014\n\u001c115\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe best interviews feel like intellectual discussions between friends (“What books are you reading right now?”). Questions should be large and complex, with a range of answers (to draw out the person’s thought process) that the interviewer can push back on (to see how the candidate stakes out and defends a position). It’s a good idea to reuse questions across candidates, so you can calibrate responses.\n\nOctober 27, 2014\n\u001c116\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cask questions that, rather than offering her a chance to regurgitate her experiences, allow her to express what insights she gained from them\n\nOctober 27, 2014\n\u001c116\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat surprised you about…?” is one good way to approach this, as it is just different enough to surprise a candidate, so you don’t get rehearsed responses, and forces her to think about her experiences from a slightly different perspective. “How did you pay for college?”\n\nOctober 27, 2014\n\u001c116\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf I were to look at the web history section of your browser, what would I learn about you that isn’t on your résumé?” Both of these can lead to a far better understanding of the candidate. They are also quite specific, which helps you gauge how well someone listens and parses questions.\n\nOctober 27, 2014\n\u001c116\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen you are in a crisis, or need to make an important decision, how do you do it?” will often reveal if a candidate is of the “if you want something done, do it yourself” ilk, or if they will rely on the people around them. The former is more likely to get frustrated with the people who work for them and thus hang on to control, the latter more likely to hire great people and have faith in them. Generic answers to these questions indicate someone who lacks insight on issues. You want the answers to be interesting or at least specific\n\nOctober 27, 2014\n\u001c116\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen preparing for an interview, it helps to keep in mind that the interviewee is not the only person being interviewed. A highly qualified candidate is evaluating you as much as you are evaluating her. If you waste the first few minutes of the interview reading her résumé and making small talk, the candidate who is considering several options (and the great candidates always have\n\nOctober 27, 2014\n\u001c117\n\u0011\n\u0011"},{"ty":"te","id":"i.49","spi":12386},{"ty":"te","id":"i.50","spi":12622},{"ty":"te","id":"i.51","spi":13001},{"ty":"te","id":"i.52","spi":13643},{"ty":"te","id":"i.53","spi":13990},{"ty":"te","id":"i.54","spi":14268},{"ty":"te","id":"i.55","spi":14713},{"ty":"te","id":"i.56","