,{"ty":"as","st":"text","si":15169,"ei":15186,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":15206,"ei":15495,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":15496,"ei":15513,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":15533,"ei":16074,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":16075,"ei":16092,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":16112,"ei":16496,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":16497,"ei":16514,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="CpbDIebKJtwE1anvd48BHcdN1XE"  nonce="CpbDIebKJtwE1anvd48BHcdN1XE">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="CpbDIebKJtwE1anvd48BHcdN1XE"  nonce="CpbDIebKJtwE1anvd48BHcdN1XE">DOCS_modelChunk = [{"ty":"is","ibi":16522,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cseveral options) may not be impressed. First impressions work both ways. While you want to ask thoughtful questions, you should also identify the candidates who ask thoughtful questions. People who ask good questions are curious, smarter, more flexible and interesting, and understand that they don’t have all the answers—exactly the type of smart-creative characteristics you want.\n\nTell me something you desperately want to teach others. How would you recruit students? Tell me something you know people want to learn. Tell me about that time you got lost in your learning (because you were so deep and excited about the topic)\n\nOctober 27, 2014\n\u001c117\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe only way to get good at interviewing is to practice. That’s why we tell young people to take advantage of every opportunity to interview\n\nOctober 27, 2014\n\u001c118\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cour best interviewers schedule time to enter their feedback right after the interview). We published these stats and let people not in the program “challenge” the incumbents and replace them if their performance was better. In other words, not interviewing was seen as punishment.\n\nOctober 27, 2014\n\u001c118\n\u0011\n\u0011\n\n\nSchedule interviews for thirty minutes\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe shorter interview time forces a conversation that’s more protein and less fat; there’s no time for small talk or meaningless questions. It forces people, including (especially!) you, into a substantive discussion\n\nOctober 27, 2014\n\u001c119\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cmaximum to five\n\nOctober 27, 2014\n\u001c120\n\u0011\n\u0011\n\n\nHave an opinion\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe encourage interviewers to take a stand. For example, on the product management team the score of 4.0 meant “This person is perfect for this role. If you don’t hire them, expect to hear from me.” This isn’t just saying we should hire the person. It’s saying, “If someone wants to get in the way of hiring this person, I will hunt you down and… passionately debate the decision based on the objective data included in the packet.” The language assigned to these scores was deliberately emotional—“expect to hear from me”—because smart creatives care about who joins their team. It’s as if they are inviting someone into their family.\n\nOctober 27, 2014\n\u001c120\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen you tell people to have an opinion, though, you need to tell them what to have an opinion about\n\nOctober 27, 2014\n\u001c121\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAt Google we break down candidate evaluations into four different categories, and we keep these categories consistent across functions.\n\nLeadership Role related knowledge General cognitive ability Cultural fit\n\nOctober 27, 2014\n\u001c121\n\u0011\n\u0011\n\n\nFriends don’t let friends hire (or promote) friends\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJune 13, 2017\n\u001c122\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cisn’t sufficient to express an opinion; you need to support it with data.\n\nOctober 27, 2014\n\u001c123\n\u0011\n\u0011\n\n\nUrgency of the role isn’t sufficiently important to compromise quality in hiring\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe urgency of the role isn’t sufficiently important to compromise quality in hiring. In the inevitable showdown between speed and quality, quality must prevail\n\nOctober 27, 2014\n\u001c126\n\u0011\n\u0011\n\n\nDisproportionate rewards\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYes, they are worth it (when they perform up to expectations), because successful athletes possess rare skills that are tremendously leverageable. When they do well, they have a disproportionate impact. They help teams win, and winning drives huge business benefits: more fans, more viewers, more jerseys and hats sold. Hence, the big money.\n\nOctober 27, 2014\n\u001c126\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou can attract the best smart creatives with factors beyond money: the great things they can do, the people they’ll work with, the responsibility and opportunities they’ll be given, the inspiring company culture and values, and yes, maybe even free food and happy dogs sitting desk-side.\n\nOctober 27, 2014\n\u001c127\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut when those smart creatives become employees and start performing, pay them appropriately.\n\nOctober 27, 2014\n\u001c127\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cbig rewards should be given to the people who are closest to great products and innovations. This means that yes, the lower-level employee who helps create a breakthrough product or feature should be very handsomely rewarded. Pay outrageously good people outrageously well, regardless of their title or tenure. What counts is their impact.109\n\nOctober 27, 2014\n\u001c128\n\u0011\n\u0011"},{"ty":"te","id":"i.60","spi":16531},{"ty":"te","id":"i.61","spi":17199},{"ty":"te","id":"i.62","spi":17378},{"ty":"te","id":"i.63","spi":17738},{"ty":"te","id":"i.64","spi":17993},{"ty":"te","id":"i.65","spi":18065},{"ty":"te","id":"i.66","spi":18738},{"ty":"te","id":"i.67","spi":18877},{"ty":"te","id":"i.68","spi":19179},{"ty":"te","id":"i.69","spi":19213},{"ty":"te","id":"i.70","spi":19408},{"ty":"te","id":"i.71","spi":19634},{"ty":"te","id":"i.72","spi":20014},{"ty":"te","id":"i.73","spi":20341},{"ty":"te","id":"i.74","spi":20473},{"ty":"as","st":"paragraph","si":16522,"ei":16522,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"