"st":"text","si":20820,"ei":20837,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="CpbDIebKJtwE1anvd48BHcdN1XE"  nonce="CpbDIebKJtwE1anvd48BHcdN1XE">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="CpbDIebKJtwE1anvd48BHcdN1XE"  nonce="CpbDIebKJtwE1anvd48BHcdN1XE">DOCS_modelChunk = [{"ty":"is","ibi":20845,"s":"\n\n\nTrade the M\u0026Ms, keep the raisins\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe best way to retain smart creatives is to not let them get too comfortable, to always come up with ways to make their jobs interesting. When Georges Harik, who was part of the team that created AdSense and who helped solve the “ads suck” problem we discussed earlier in the book, was thinking about leaving the company, Eric suggested that he might be interested in sitting in on his staff meetings\n\nOctober 27, 2014\n\u001c128\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut often it takes more than interesting side projects to keep people engaged and prevent them from leaving. You need to prioritize the interests of the highly valued individual over the constraints of the organization. Salar Kamangar, whom the founders hired straight out of Stanford, is a great example of this. Salar helped invent AdWords and spent several years in the product organization, but when he was ready to expand his responsibilities and become a general manager, we didn’t have a role for him. So we created one, appointing him the head of YouTube.\n\nOctober 27, 2014\n\u001c129\n\u0011\n\u0011\n\n\n■ Google’s Hiring Dos and Don’ts\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHire people who are smarter and more knowledgeable than you are. Don’t hire people you can’t learn from or be challenged by.\n\nKeep this is mind when bringing new staff to Yushin Youth Project 2015. Do this when bringing in speakers.\n\nOctober 29, 2014\n\u001c133\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOctober 27, 2014\n\u001c133\n\u0011\n\u0011\n\n\nTreat your career like you are surfing\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe right industry is paramount, because while you will likely switch companies several times in your career, it is much harder to switch industries. Think of the industry as the place you surf (in Northern California the most rad waves are at Mavericks, dude) and the company as the wave you catch. You always want to be in the place with the biggest and best waves.\n\nCould medicine be the right industry for me? For value I can create for others?\n\nOctober 27, 2014\n\u001c134\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cif you choose the wrong industry early in your career, then growth opportunities within your company will be limited. Your boss won’t move, and you’ll be stuck without much leverage when you’re ready to look for jobs at other companies.\n\nOctober 27, 2014\n\u001c135\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFortunately, the tectonic forces driving the Internet Century mean that a lot of industries are great places to surf.\n\nOctober 27, 2014\n\u001c135\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cmedia, entertainment, and consumer electronics\n\nOctober 27, 2014\n\u001c135\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe most interesting industries are those where product cycle times are accelerating, because this creates more chances for disruption and so more opportunities for fresh talent.\n\nCan education be this? edtech bubble?\n\nOctober 27, 2014\n\u001c135\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFrom a compensation standpoint, stock options and other forms of equity are quite limited early in your career, so it’s more lucrative to develop expertise in the right industry than to bet on a particular company.\n\nOctober 27, 2014\n\u001c135\n\u0011\n\u0011\n\n\nAlways listen for those who get technology\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001clisten for the people who truly get technology. These are the genius-level smart creatives who see, before the rest of us, where technology is going and how it will transform industries.\n\nTalk to clay asap\n\nOctober 29, 2014\n\u001c135\n\u0011\n\u0011\n\n\nPlan your career\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThink about your ideal job, not today but five years from now. Where do you want to be? What do you want to do? How much do you want to make? Write down the job description: If you saw this job on a website, what would the posting look like? Now fast forward four or five years and assume you are in that job. What does your five-years-from-now résumé look like? What’s the path you took from now to then to get to your best place? Keep thinking about that ideal job, and assess your strengths and\n\nOctober 27, 2014\n\u001c136\n\u0011\n\u0011\n\n\nStatistics is the new plastics\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHal Varian notes that it is always a good idea for individuals to build expertise in areas that complement things that are getting cheap, and data, along with computing power to crunch it, is definitely getting cheap. We are in the era of big data, and big data needs statisticians to make sense of it. The democratization of data means that those who can analyze it well will win. Data is the sword of the twenty-first century, those who wield it well, the samurai. So start sharpening that blade, uruwashii,114 and take statistics.\n\nThat class tho...\n\nOctober 27, 2014\n\u001c137\n\u0011\n\u0011"},{"ty":"te","id":"i.75","spi":20889