y":"as","st":"text","si":25261,"ei":25278,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="CpbDIebKJtwE1anvd48BHcdN1XE"  nonce="CpbDIebKJtwE1anvd48BHcdN1XE">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="CpbDIebKJtwE1anvd48BHcdN1XE"  nonce="CpbDIebKJtwE1anvd48BHcdN1XE">DOCS_modelChunk = [{"ty":"is","ibi":25286,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNo matter your business, learn how the right data, crunched the right way, will help you make better decisions. Learn which questions to ask the people who are good with numbers and how to make the best use of their replies. Even if you aren’t a numbers person, you can learn how to use the numbers to get smarter\n\nOctober 27, 2014\n\u001c137\n\u0011\n\u0011\n\n\nRead\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cpeople and swap books and articles. One of the best, easiest ways to get ahead in a field is to know more about it. The best way to do that is to read. People always say they don’t have the time to read\n\nOctober 27, 2014\n\u001c138\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou know who reads a lot about their business? CEOs. So think like a CEO and read.\n\nOctober 27, 2014\n\u001c138\n\u0011\n\u0011\n\n\nKnow your elevator pitch\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJob seekers should also have an elevator pitch. This shouldn’t be a condensed version of your résumé, but should rather highlight its most interesting parts along with what you want to do and the impact you know you will have—the benefit to the customer and the company. What can you say that no one else can?\n\nOctober 27, 2014\n\u001c138\n\u0011\n\u0011\n\n\nCombine passion with contribution\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSheryl Sandberg: “It is the ultimate luxury to combine passion and contribution. It’s also a very clear path to happiness.”115 She couldn’t be more right. You will not be as successful as you could be if you only like what you do and don’t love it. Trite, perhaps, but true. Sheryl is also right in saying that combining passion and contribution is a luxury: not that it’s expensive, but just rare. It’s something that many people either can’t figure out (how many people truly know their passion at the outset of their careers?)\n\nContribution-wise, I wanna work with high-schools and uni-aged kids and teach. I want to do something hard, and be a near expert. I want to do something related to science and entrepreneurship. Medicine would let me do teaching, mental health, science research, commercialization, public health, innovation, and give me a group of peers and a way I can measure myself. It would be comforting to have a career path again... In 5 years I could be closer to doing these things, as a MD/MBA student... I can then decide if I wanna do teaching, or entrepreneurship, and I would also likely have better technical skills to complement my better human skills. In terms of industry wave to ride, I can be in medicine (which is changing thanks to data), or education (edtech) or even politics one day (look at Ben Carson and George W. Bush...the MBA will help). Also, Bo might join me in the journey. It\u0027d be great to study in the same city and even live together. I can punk the MCAT - studying will be good for me to get smarter again and keep me disciplined. And the MCAT is changing to include subjects I think are important. How to go about taking the gen chem, biochem, and perhaps one clinical class to get myself back in the game? Where to get that last rec? Experience? (Such as GHIT fund or mental health or the professor at Sophia or Oculus)...\n\nOctober 29, 2014\n\u001c139\n\u0011\n\u0011\n\n\nDecisions—The True Meaning of Consensus\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe answer lies in understanding that when it comes to making decisions, you can’t just focus on making the right one. The process by which you reach the decision, the timing of when you reach it, and the way it is implemented are just as important as the decision itself.\n\nOctober 27, 2014\n\u001c147\n\u0011\n\u0011\n\n\nDecide with data\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthe plural of anecdote is data,”122 which means, by our interpretation, that if you don’t have data, you can’t decide.\n\nOctober 27, 2014\n\u001c151\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSlides should not be used to run a meeting or argue a point. They should just contain the data, so that everyone has the same facts.\n\nOctober 27, 2014\n\u001c151\n\u0011\n\u0011\n\n\nBeware the bobblehead yes\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdebate their points in an open environment, because you won’t get buy-in until all the choices are debated openly. They’ll bobblehead nod, then leave the room and do what they want to do. So to achieve true consensus, you need dissent. If you are in charge, do not state your position at the outset of the process. The job is to make sure everyone’s voice is heard, regardless of their functional role, which is harder to achieve when the top dog puts a stake in the ground.\n\nOctober 27, 2014\n\u001c153\n\u0011\n\u0011"},{"ty":"te","id":"i.88","spi":25295},{"ty":"te","id":"i.89","spi":25654},{"ty":"te","id":"i.90","spi":25895},{"ty":"te","id":"i.91","spi":26043},{"ty":"te","id":"i.92","spi":26427},{"ty":"te","id":"i.93","spi":28384},{"ty":"te","id":"i.94","spi":28714},{"ty":"te","id":"i.95","spi":28871},{"ty":"te","id":"i.96","spi":29070},{"ty":"as","st":"paragraph","si":25286,"ei":25286,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i