"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":29549,"ei":29566,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="CpbDIebKJtwE1anvd48BHcdN1XE"  nonce="CpbDIebKJtwE1anvd48BHcdN1XE">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="CpbDIebKJtwE1anvd48BHcdN1XE"  nonce="CpbDIebKJtwE1anvd48BHcdN1XE">DOCS_modelChunk = [{"ty":"is","ibi":29574,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf everyone is thinking alike, then somebody isn’t thinking.”125 If you’ve hired well, there’s good news: There is dissension in the ranks. Lots of people are thinking. Smart creatives, especially at the most senior leadership level, should and usually do think of themselves as owners of the business, rather than leaders of just their particular area. Therefore they should have opinions, and quite possibly valuable insights, even about decisions that fall outside their realm. Encourage this, since it helps build a stronger bond among the team and stronger support for the ultimate decision. Using data can be helpful to get everyone to weigh in, since it’s not personal.126 Be especially aware of the quiet people; call on the ones who haven’t spoken up yet. They may be dissenters who are afraid to disagree with you in public (but need to\n\nOctober 27, 2014\n\u001c153\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOne technique is to throw out a few “stupid softballs” that let people dip their toe in the water of disagreeing with the boss. (“I think we should all pour hydrochloric acid on ourselves. Thoughts?”) Do your best to surface all potential dissent early in the process; there is a natural (and valid) bias toward rejecting dissent the later it surfaces in the decision-making process.127\n\nOctober 27, 2014\n\u001c154\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cproper consensus-driven process has elements of inclusion (involving all the stakeholders in a participatory manner); cooperation (aiming for the best decision for the group, sometimes at the expense of a minority or individual); and equality (everyone on the team counts and can at\n\nOctober 27, 2014\n\u001c154\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAbove all it is solution-oriented: The right decision is the best decision, not the lowest common denominator decision upon which everyone agrees. And it’s not always your solution. As Coach Wooden once said, “Be interested in finding the best way, not in having your own way.”\n\nOctober 27, 2014\n\u001c154\n\u0011\n\u0011\n\n\nKnow when to ring the bell\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThis conflict-based approach works only if it is managed by a single decision-maker who owns the deadline and will break a tie.\n\nSet a deadline, run the process, enforce the deadline, and make a decision\n\nOctober 27, 2014\n\u001c154\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cExhibit a bias for action, to cut off debate and analysis that is no longer valuable, and start moving the team to rally around the decision. But don’t be a slave to a sense of urgency. Maintain flexibility until the last possible moment\n\nOctober 27, 2014\n\u001c156\n\u0011\n\u0011\n\n\n“You’re both right”\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen ending a debate and making a decision that doesn’t have 100 percent support, remember these three words: “You’re both right.” To emotionally commit to a decision with which they don’t agree, people have to know that their opinion was not only heard, but valued. “You’re both right” accomplishes this. It tells the person whose argument lost that there are elements of truth amidst the rubble of their failed position. It provides an emotional boost—people like hearing that they are right. And fortunately, it is often true, since in a group of smart creatives there are usually elements of truth in everyone’s position. It’s rare for a good person to be completely, 100 percent wrong.\n\nOctober 27, 2014\n\u001c160\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdisagree but commit, or escalate publicly. If it’s the latter, then the escalator must let the decision-maker know the reasons for her objections, and how and to which higher-up she plans to escalate. (“I’m sorry, I still don’t think this is the right decision because of.… How about we see what Barack thinks?”) Public escalation is a valid option and should be encouraged, because if you don’t it will just happen anyway, only with a lot more rancor.\n\nOctober 27, 2014\n\u001c161\n\u0011\n\u0011\n\n\nEvery meeting needs an owner\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ca well-run meeting is a great thing. It’s the most efficient way to present data and opinions, to debate issues, and yes, to actually make decisions\n\nOctober 27, 2014\n\u001c161\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMeetings should have a single decision-maker/owner. There must be a clear decision-maker at every point in the process, someone whose butt is on the line. A meeting between two groups of equals often doesn’t result in a good outcome, because you end up compromising rather than making the best tough decisions. Include someone more senior as the decision-maker. The decision-maker should be hands on. He or she should call the meeting, ensure that the content is good, set the objectives, determine the participants, and share the agenda (if possible) at leas