odelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="CpbDIebKJtwE1anvd48BHcdN1XE"  nonce="CpbDIebKJtwE1anvd48BHcdN1XE">DOCS_modelChunk = [{"ty":"is","ibi":34157,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdecision-maker (and no one else) should summarize decisions taken and action items by email to at least every participant—as well as any others who need to know—within forty-eight hours. Even if a meeting is not a decision-making meeting—for example it’s designed to share information or brainstorm solutions—it should have a clear owner. Again, that owner should ensure that the right people are invited to the meeting, that there’s a clear agenda, that the necessary prep work has been done in advance, and that action items are circulated promptly.\n\nOctober 27, 2014\n\u001c161\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you attend a meeting, attend the meeting. Multitasking doesn’t work. If you are in a meeting and using your laptop or phone for something not related to the meeting, it’s obvious your time is better spent elsewhere. Everyone attending a meeting should focus on the meeting, not other work.\n\nOctober 27, 2014\n\u001c163\n\u0011\n\u0011\n\n\n■ The World’s Best Athletes Need Coaches, and You Don’t?\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe first ingredient of a successful coaching relationship is a student who is willing to listen and learn. Just like there are hard-to-coach athletes, there are hard-to-coach executives. But once they get past that initial reticence, they find there are always things to learn. Business coaches, like all coaches, are at heart teachers, and Bill Campbell, the best coach around, tells us he believes that management is a skill that is completely learnable.\n\nOctober 27, 2014\n\u001c168\n\u0011\n\u0011\n\n\nDefault to open\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOKRs are another great example of transparency. These are an individual’s Objectives (the strategic goals to accomplish) and Key Results (the way in which progress toward that goal is measured). Every employee updates and posts his OKRs company-wide every quarter, making it easy for anyone to quickly find anyone else’s prioritie\n\nOctober 27, 2014\n\u001c175\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOf course, this starts at the top. Every quarter at Google, Larry—like Eric before him—posts his OKRs and hosts a company-wide meeting to discuss them. All the various product and business leads join him onstage to talk through each OKR and what it means for their teams, and to grade themselves on how they performed against the previous quarter’s OKRs. This isn’t for show—the OKRs are real objectives, hammered out between the various product leaders at the outset of each quarter, and the grades of the previous quarter’s OKRs are usually full of red and yellow marks.\n\nOctober 27, 2014\n\u001c176\n\u0011\n\u0011\n\n\nReview yourself\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe best tool we have found for this is the self-review: At least once per year, write a review of your own performance, then read it and see if you would work for you. And then, share it with the people who do in fact work for you. This will elicit greater insights than the standard 360-degree review process, because when you are initiating criticism\n\nOctober 27, 2014\n\u001c187\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001courself it gives others the freedom to be more honest\n\nOctober 27, 2014\n\u001c187\n\u0011\n\u0011\n\n\nEmail wisdom\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cRespond quickly. There are people who can be relied upon to respond promptly to emails, and those who can’t.\n\nOctober 27, 2014\n\u001c188\n\u0011\n\u0011\n\n\nHave a playbook\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBoard members want to talk about strategy and products\n\nOctober 27, 2014\n\u001c192\n\u0011\n\u0011\n\n\nWhat is innovation?\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cfor something to be innovative it needs to offer new functionality, but it also has to be surprising. If your customers are asking for it, you aren’t being innovative when you give them what they want; you are just being responsive. That’s a good thing, but it’s not innovative. Finally, “useful” is a rather underwhelming adjective to describe that innovation hottie, so let’s add an adverb and make it radically useful. Voilà: For something to be innovative, it needs to be new, surprising, and radically useful.\n\nOctober 27, 2014\n\u001c202\n\u0011\n\u0011\n\n\nThe CEO needs to be the CIO\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cInnovative people do not need to be told to do it, they need to be allowed to do it.” In other words, innovation has to evolve organically. It is the final destination of a path that starts when ideas spawn like mutations from a primordial ooze and traverse a long, perilous route from inception to fruition. Along the way, stronger ideas accumulate believers and momentum, and weaker ones fall to the wayside. There is no process by which to implement this evolution; its defining characteristic is its lack of process\n\nOctober 27, 2014\n\u001c206\n\u0011\n\u0011"},{"ty":"te","id":"i.107","spi":34166},{"ty":"te","id":"i.108","spi":34756},{"ty":"te","id":"i.109","spi":35146},{"ty":"te","id":"i.110","spi":35660},{"ty":"te","id":"i.111","spi":36029},{"ty":"te","id":"i.112","spi":36658},{"ty":"te","id":"i.113","spi":37050},{"ty":"te","id":"i.114","spi":37157},{"ty":"te","id":"i.115","spi":37322},{"ty":"te","id":"i.116","spi":37437},{"ty":"te","id":"i.117","spi":38020},{"ty":"as","st":"paragraph","si":34157,"ei":34157,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":34158,"ei":34158,"sm":{"ps_klt_i