_i":false}},{"ty":"as","st":"text","si":38544,"ei":38561,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="CpbDIebKJtwE1anvd48BHcdN1XE"  nonce="CpbDIebKJtwE1anvd48BHcdN1XE">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="CpbDIebKJtwE1anvd48BHcdN1XE"  nonce="CpbDIebKJtwE1anvd48BHcdN1XE">DOCS_modelChunk = [{"ty":"is","ibi":38569,"s":"\n\n\nFocus on the user…\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe full sentence should read “focus on the user and all else will follow.” This means that we will always do what’s right\n\nOctober 27, 2014\n\u001c210\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cor the user, and we trust that our smart creatives will figure out how to make money from it.\n\nOctober 27, 2014\n\u001c210\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThis simple insight—that people downloading Earth might be interested in getting Toolbar as well—increased Toolbar’s user base significantly and generated lots of revenue, but there’s practically no way Jonathan could have anticipated it when he stood before the board that day. Looking back, we realize the correct answer would have been, “I have no idea… but I’m sure we’ll figure it out.” Focus on the user… and the money will follow.\n\nOctober 27, 2014\n\u001c211\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAt Google, our users are the people who use our products, while our customers are the companies that buy our advertising                                         \n\nOctober 27, 2014\n\u001c212\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt has to be this way, regardless of your industry. Users are more empowered than ever, and won’t tolerate crummy products.\n\nOctober 27, 2014\n\u001c212\n\u0011\n\u0011\n\n\nThink big\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt can also be easier to take on big problems because bigger challenges attract big talent. There is a symbiotic relationship between big challenges and highly smart, skilled people: The challenges get solved and the people get happy. Give the wrong people a big challenge, and you’ll induce anxiety. But give it to the right people, and you’ll induce joy.170 They enjoy rising to the challenge for the sake of it, but also, as sociologist and management guru Rosabeth Moss Kanter has pointed out, for the very real benefits it can bring: new skills, new connections with colleagues in the field, enhanced reputation—what economists would describe as investing in their human capital.171 For these reasons, thinking big is actually a very powerful tool for attracting and retaining smart creatives. Put it this way: Let’s assume you are a brilliant smart creative just graduating from college\n\nOctober 27, 2014\n\u001c214\n\u0011\n\u0011\n\n\nSet (almost) unattainable goals\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe best OKRs are aggressive, but realistic. Under this strange arithmetic, a score of 70 percent on a well-constructed OKR is often better than 100 percent on a lesser one.\n\nOctober 27, 2014\n\u001c217\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAnd there’s one final benefit of an OKR-driven culture: It helps keep people from chasing competitors. Competitors are everywhere in the Internet Century, and chasing them (as we noted earlier) is the fastest path to mediocrity. If employees are focused on a well-conceived set of OKRs,\n\nOctober 27, 2014\n\u001c217\n\u0011\n\u0011\n\n\n70/20/10\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c70/20/10 became our rule for resource allocation: 70 percent of resources dedicated to the core business, 20 percent on emerging, and 10 percent on new.\n\nOctober 27, 2014\n\u001c218\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTen percent also works because creativity loves constraints.175 It’s why pictures have frames and sonnets have fourteen lines. It’s why Henry Ford set pricing for his cars so low, because he knew that “We make more discoveries concerning manufacturing and selling under this forced method than by any method of leisurely investigation”.176 A lack of resources forces ingenuity.\n\nOctober 27, 2014\n\u001c219\n\u0011\n\u0011\n\n\n20 percent time\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe first step toward bringing a good idea to fruition is to build a team of people who are committed to it, and while we may be clueless, your peers probably are not. Our constant advice to anyone who wants to launch a 20 percent project is to start by building a prototype, because that’s how you get people excited about the project. Coming up with an idea is pretty easy. Getting a few of your colleagues to join your project and add their 20 percent time to your 20 percent time is a lot harder. This is where the Darwinian process begins.\n\nOctober 27, 2014\n\u001c223\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOne of our search teams tries to circumvent this through a program called “demo days.” The concept is pretty simple: A team spends a week building prototypes of new ideas that they will be expected to demo by the end of the week. Before the week starts, the engineers clear their calendars of all meetings and launches, no exceptions. This not only makes the demo days logistically possible, it serves as a forcing function to get everyone to commit. Since some people may be expected to work in unfamiliar areas, they can get training in the systems they may want to use. All systems are set up and ready to go,\n\nOctober 27, 2014\n\u001c224\n\u0011\n