c_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":42429,"ei":42446,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":42466,"ei":43079,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":43080,"ei":43097,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="CpbDIebKJtwE1anvd48BHcdN1XE"  nonce="CpbDIebKJtwE1anvd48BHcdN1XE">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="CpbDIebKJtwE1anvd48BHcdN1XE"  nonce="CpbDIebKJtwE1anvd48BHcdN1XE">DOCS_modelChunk = [{"ty":"is","ibi":43105,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cno teams of one are allowed—and are encouraged to collaborate with people they don’t normally work with on a daily basis. Then the week starts and they get on it.\n\nOctober 27, 2014\n\u001c224\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cisn’t the products and features that get created, it’s the things that people learn when they try something new. Most 20 percent projects require people to practice or develop skills outside of those they use on a day-to-day basis, often collaborating with colleagues they don’t regularly work with. Even if these projects rarely yield some new, wow innovation, they always yield smarter smart creatives. As Urs Hölzle likes to point out, 20 percent time may be the best educational program a company can have.\n\nOctober 27, 2014\n\u001c225\n\u0011\n\u0011\n\n\nShip and iterate\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cCreate a product, ship it, see how it does, design and implement improvements, and push it back out. Ship and iterate. The companies that are the fastest at this process will win.\n\nOctober 27, 2014\n\u001c228\n\u0011\n\u0011\n\n\nFail well\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTo innovate, you must learn to fail well. Learn from your mistakes: Any failed project should yield valuable technical, user, and market insights that can help inform the next effort. Morph ideas, don’t kill them: Most of the world’s great innovations started out with entirely different applications, so when you end a project, look carefully at its components to see how they might be reapplied\n\nOctober 27, 2014\n\u001c233\n\u0011\n\u0011\n\n\nIt’s not about money\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe don’t provide any monetary incentive for 20 percent projects for the simple reason that we don’t need to: It may sound corny, but the reward comes from the work itself. Several studies have shown that extrinsic rewards don’t encourage creativity, and in fact hinder it, by turning an inherently rewarding endeavor into a money-earning chore\n\nOctober 27, 2014\n\u001c234\n\u0011\n\u0011\n\n\nAsk the hardest questions\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001congoing companies there are always hard questions, and they often don’t get asked because there aren’t any good answers and that makes people uncomfortable.\n\nOctober 27, 2014\n\u001c246\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cStart by asking what could be true in five years. Larry Page often says that the job of a CEO is not only to think about the core business, but also the future; most companies fail because they get too comfortable doing what they have always done, making only incremental changes. And that is especially fatal today, when technology-driven change is rampant. So the question to ask isn’t what will be true, but what could be true. Asking what will be true entails making a prediction, which is folly in a fast-moving world.205 Asking what could be true entails imagination: What thing that is unimaginable when abiding by conventional wisdom is in fact\n\nIGS, Grow, what could be true in 5 years?\n\nOctober 27, 2014\n\u001c246\n\u0011\n\u0011"}
}'


